Natuurlijk kent iedereen Santa Claus (Paul Giamatti), maar niemand kent zijn verbitterde, oudere broer Fred (Vince Vaughn). De 
twee broers zijn elkaars tegenpolen en juist het feit dat zijn jongere broertje zo geliefd is, is Fred een doorn in het oog. Er 
ontstaat dan ook een groot probleem wanneer Fred gedwongen wordt om eveneens naar de Noordpool te verhuizen.
